Mainly{sea,}the only land areas are in the SW and SE corners. In the SE the tip of the eastern headland of Bouley Bay just enters the block. The headland forms a distinct and rocky promontory that is known as the{Tour } {de Rozel}and forms a land mark for mariners.
In the SW, the land area is divided between the{extensive sweep of cliff} forming the western side of Bouley Bay and an{arable farming area}at the northern head of a small south running valley. The vegetation of the headland is dominated by bracken, gorse and bramble.
A small cluster of{houses}at the head of the valley backs onto the heathland where there is a{Decca } {navigation transmitter. }
